import{_ as e,c as t,o,d as a}from"./app.a07ec8df.js";const g=JSON.parse('{"title":"\u7F16\u5199\u81EA\u52A8\u5316\u6D4B\u8BD5","description":"","frontmatter":{},"headers":[],"relativePath":"ch11-00-testing.md","lastUpdated":1671182487000}'),s={name:"ch11-00-testing.md"},c=a('<h1 id="\u7F16\u5199\u81EA\u52A8\u5316\u6D4B\u8BD5" tabindex="-1">\u7F16\u5199\u81EA\u52A8\u5316\u6D4B\u8BD5 <a class="header-anchor" href="#\u7F16\u5199\u81EA\u52A8\u5316\u6D4B\u8BD5" aria-hidden="true">#</a></h1><blockquote><p><a href="https://github.com/rust-lang/book/blob/main/src/ch11-00-testing.md" target="_blank" rel="noreferrer">ch11-00-testing.md</a><br> commit 1fedfc4b96c2017f64ecfcf41a0a07e2e815f24f</p></blockquote><p>Edsger W. Dijkstra \u5728\u5176 1972 \u5E74\u7684\u6587\u7AE0\u3010\u8C26\u5351\u7684\u7A0B\u5E8F\u5458\u3011\uFF08\u201CThe Humble Programmer\u201D\uFF09\u4E2D\u8BF4\u5230 \u201C\u8F6F\u4EF6\u6D4B\u8BD5\u662F\u8BC1\u660E bug \u5B58\u5728\u7684\u6709\u6548\u65B9\u6CD5\uFF0C\u800C\u8BC1\u660E\u5176\u4E0D\u5B58\u5728\u65F6\u5219\u663E\u5F97\u4EE4\u4EBA\u7EDD\u671B\u7684\u4E0D\u8DB3\u3002\u201D\uFF08\u201CProgram testing can be a very effective way to show the presence of bugs, but it is hopelessly inadequate for showing their absence.\u201D\uFF09\u8FD9\u5E76\u4E0D\u610F\u5473\u7740\u6211\u4EEC\u4E0D\u8BE5\u5C3D\u53EF\u80FD\u5730\u6D4B\u8BD5\u8F6F\u4EF6\uFF01</p><p>\u7A0B\u5E8F\u7684\u6B63\u786E\u6027\u610F\u5473\u7740\u4EE3\u7801\u5982\u6211\u4EEC\u671F\u671B\u7684\u90A3\u6837\u8FD0\u884C\u3002Rust \u662F\u4E00\u4E2A\u76F8\u5F53\u6CE8\u91CD\u6B63\u786E\u6027\u7684\u7F16\u7A0B\u8BED\u8A00\uFF0C\u4E0D\u8FC7\u6B63\u786E\u6027\u662F\u4E00\u4E2A\u96BE\u4EE5\u8BC1\u660E\u7684\u590D\u6742\u4E3B\u9898\u3002Rust \u7684\u7C7B\u578B\u7CFB\u7EDF\u5728\u6B64\u95EE\u9898\u4E0A\u4E0B\u4E86\u5F88\u5927\u7684\u529F\u592B\uFF0C\u4E0D\u8FC7\u5B83\u4E0D\u53EF\u80FD\u6355\u83B7\u6240\u6709\u79CD\u7C7B\u7684\u9519\u8BEF\u3002\u4E3A\u6B64\uFF0CRust \u4E5F\u5728\u8BED\u8A00\u672C\u8EAB\u5305\u542B\u4E86\u7F16\u5199\u8F6F\u4EF6\u6D4B\u8BD5\u7684\u652F\u6301\u3002</p><p>\u4F8B\u5982\uFF0C\u6211\u4EEC\u53EF\u4EE5\u7F16\u5199\u4E00\u4E2A\u53EB\u505A <code>add_two</code> \u7684\u5C06\u4F20\u9012\u7ED9\u5B83\u7684\u503C\u52A0\u4E8C\u7684\u51FD\u6570\u3002\u5B83\u7684\u7B7E\u540D\u6709\u4E00\u4E2A\u6574\u578B\u53C2\u6570\u5E76\u8FD4\u56DE\u4E00\u4E2A\u6574\u578B\u503C\u3002\u5F53\u5B9E\u73B0\u548C\u7F16\u8BD1\u8FD9\u4E2A\u51FD\u6570\u65F6\uFF0CRust \u4F1A\u8FDB\u884C\u6240\u6709\u76EE\u524D\u6211\u4EEC\u5DF2\u7ECF\u89C1\u8FC7\u7684\u7C7B\u578B\u68C0\u67E5\u548C\u501F\u7528\u68C0\u67E5\uFF0C\u4F8B\u5982\uFF0C\u8FD9\u4E9B\u68C0\u67E5\u4F1A\u786E\u4FDD\u6211\u4EEC\u4E0D\u4F1A\u4F20\u9012 <code>String</code> \u6216\u65E0\u6548\u7684\u5F15\u7528\u7ED9\u8FD9\u4E2A\u51FD\u6570\u3002Rust \u6240 <strong>\u4E0D\u80FD</strong> \u68C0\u67E5\u7684\u662F\u8FD9\u4E2A\u51FD\u6570\u662F\u5426\u4F1A\u51C6\u786E\u7684\u5B8C\u6210\u6211\u4EEC\u671F\u671B\u7684\u5DE5\u4F5C\uFF1A\u8FD4\u56DE\u53C2\u6570\u52A0\u4E8C\u540E\u7684\u503C\uFF0C\u800C\u4E0D\u662F\u6BD4\u5982\u8BF4\u53C2\u6570\u52A0 10 \u6216\u51CF 50 \u7684\u503C\uFF01\u8FD9\u4E5F\u5C31\u662F\u6D4B\u8BD5\u51FA\u573A\u7684\u5730\u65B9\u3002</p><p>\u6211\u4EEC\u53EF\u4EE5\u7F16\u5199\u6D4B\u8BD5\u65AD\u8A00\uFF0C\u6BD4\u5982\u8BF4\uFF0C\u5F53\u4F20\u9012 <code>3</code> \u7ED9 <code>add_two</code> \u51FD\u6570\u65F6\uFF0C\u8FD4\u56DE\u503C\u662F <code>5</code>\u3002\u65E0\u8BBA\u4F55\u65F6\u5BF9\u4EE3\u7801\u8FDB\u884C\u4FEE\u6539\uFF0C\u90FD\u53EF\u4EE5\u8FD0\u884C\u6D4B\u8BD5\u6765\u786E\u4FDD\u4EFB\u4F55\u73B0\u5B58\u7684\u6B63\u786E\u884C\u4E3A\u6CA1\u6709\u88AB\u6539\u53D8\u3002</p><p>\u6D4B\u8BD5\u662F\u4E00\u9879\u590D\u6742\u7684\u6280\u80FD\uFF1A\u867D\u7136\u4E0D\u80FD\u5728\u4E00\u4E2A\u7AE0\u8282\u7684\u7BC7\u5E45\u4E2D\u4ECB\u7ECD\u5982\u4F55\u7F16\u5199\u597D\u7684\u6D4B\u8BD5\u7684\u6BCF\u4E2A\u7EC6\u8282\uFF0C\u4F46\u6211\u4EEC\u8FD8\u662F\u4F1A\u8BA8\u8BBA Rust \u6D4B\u8BD5\u529F\u80FD\u7684\u673A\u5236\u3002\u6211\u4EEC\u4F1A\u8BB2\u5230\u7F16\u5199\u6D4B\u8BD5\u65F6\u4F1A\u7528\u5230\u7684\u6CE8\u89E3\u548C\u5B8F\uFF0C\u8FD0\u884C\u6D4B\u8BD5\u7684\u9ED8\u8BA4\u884C\u4E3A\u548C\u9009\u9879\uFF0C\u4EE5\u53CA\u5982\u4F55\u5C06\u6D4B\u8BD5\u7EC4\u7EC7\u6210\u5355\u5143\u6D4B\u8BD5\u548C\u96C6\u6210\u6D4B\u8BD5\u3002</p>',7),r=[c];function d(n,i,_,p,h,f){return o(),t("div",null,r)}const l=e(s,[["render",d]]);export{g as __pageData,l as default};
